  render() {  const [show, setShow] = useState(false);
    const closeModalHandler = () => setShow(false);
    return (
        <button className="btn-warning myshadowbut minibutton" onClick={() => setShow(true)} className="btn-openModal">
          <CreateIcon className="CreateIcon" />
          Schrijf je in
        </button>
    );
  }
}

export default Button;
